import React, { Component } from 'react'

import 'bootstrap/dist/css/bootstrap.min.css'

export default class CardScore extends Component {
   render() {

      const { headerText, bodyText, cardText } = this.props;

      return (
         <div class="card bg-primary m-2 text-white">
            <div class="card-body">
               <div class="pull-left">{this.props.title}</div>
               <div class="text-right">
                  <span class="fa fa-arrow-alt-circle-down text-right"></span>
                  <b class="pull-right text-right">{this.props.mainval}</b>
               </div>
               <h1>
                  <span class="fa fa-stopwatch"></span>
                  <span class="text-right">{this.props.secondval}</span>
               </h1>
            </div>
         </div>
      )
   }
}
